import { Component, useState } from "react"

function navBar() {

    const [loggedIn, setLogin] = useState(false)

    function render_navBar_right_components(logged_in) {
        if (logged_in) {
            return (
                <ul class="nav navbar-nav navbar-right">
                    <li><a href="/User"><span class="glyphicon glyphicon-user"></span> User</a></li>
                    <li><a href="/Logout"><span class="glyphicon glyphicon-log-out"></span> Logout</a></li>
                </ul>
            )
        } else {
            return (
                <ul class="nav navbar-nav navbar-right">
                    <li><a href="/Register"><span class="glyphicon glyphicon-list-alt"></span> Register</a></li>
                    <li><a href="/Login"><span class="glyphicon glyphicon-log-in"></span> Login</a></li>
                </ul>
            )
        }
    }

    return (
        <div >
            <link rel="stylesheet" href="https://maxcdn.bootstrapcdn.com/bootstrap/3.4.1/css/bootstrap.min.css" />
            <script src="https://ajax.googleapis.com/ajax/libs/jquery/3.5.1/jquery.min.js"></script>
            <script src="https://maxcdn.bootstrapcdn.com/bootstrap/3.4.1/js/bootstrap.min.js"></script>

            <nav class="navbar navbar-inverse">
                <div class="container-fluid">
                    <div class="navbar-header">
                        <a class="navbar-brand" href="/">Playlist Converter!</a>
                    </div>
                    <ul class="nav navbar-nav">
                        <li class="active"><a href="/">Home</a></li>
                        <li><a href="/about">About</a></li>
                    </ul>
                    {render_navBar_right_components(loggedIn)}
                </div>
            </nav>
        </div>
    )

}

export default navBar
